import React from 'react'

const Title=({name,title})=> {
    return (
        <div className="row">
            <div className="col s12 text-title text-center">
                <h1 className="text-capitalize font-weight-bold">
                    {name}<strong className="blue-text">{title}</strong>
                </h1>
            </div>
            
        </div>
    )
}

export default Title
